import React from 'react';
import PropTypes from 'prop-types';

import './skl-ds-divider.css';

export const Divider = ({ color, size}) => {
  return (
    <div class="skl-ds-divider"></div>
  );
};

Divider.propTypes = {
  color: PropTypes.string, 
};

Divider.defaultProps = {
  color: '#000', 
};
